import './App.css';
import Dashboard from './Page/Dashboard';
import { Route } from "react-router-dom";
import { BrowserRouter as Router, Switch, Route as RouterRoute } from 'react-router-dom';
import Login from "./Page/Dashboard/login.js";

function App() {
  return (
    <div>
      <Router>
        <Dashboard />
        <Switch>
          {/* other routes */}
          <RouterRoute exact path="/login" component={Login} />
          {/* other routes */}
        </Switch>
      </Router>
    </div>
  );
}

export default App;
